  return (
    <>
      {/* Sidebar - collapses into a top navbar on smaller screens */}
     {/* <Sidebar/> */}
      {/* Fixed Header */}
      
    {/* <AdminHeader/> */}
      {/* Main Content */}
      <div className="container mt-5" >
    
      <div className="container">
        <h1><a>Dashboard</a></h1>
        <hr/>

      </div>
     {/* content heree */}
      </div>
      

      {/* Footer */}
      
    </>
  );
};

export default Dashboard;
